import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import ResultListContainer from "./src/screens/ResultListContainer";
import { restaurantList } from "./src/screens/restaurantsList";
import MainList from "./src/screens/MainList";

export default function App() {
  return (
    <View style={styles.container}>
      <ResultListContainer restaurantList={restaurantList} />
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
